import React, { Component } from 'react';
import Image from '../../../images/img_avatar.png';
import dropDown from '../../../images/icons/more.png';

class Header extends Component {

    render() {
        const dropLeft = {
            left: "50%",
            right: "10%",
            width: "200px"
        }
        return (
            <div>
                <nav className="navbar navbar-light bg-light p-0 row fixed">
                    <div className="col-md-2 bg-primary w-100 text-center py-0">                
                            <div className="row p-1">
                            <div className="col-sm-4 my-auto p-0"><img src={Image} width="30" height="30" className="rounded-circle" /></div>
                            <div className="col p-0"><span className="navbar-brand mb-0 display-4 text-light mx-auto">Student Name</span></div>
                            </div>
                    </div>
                    <div className="col-md-10 float-right pr-4">
                        <div className="float-right postion-relative">
                            <a className="nav-link dropdown p-0 m-0" data-toggle="dropdown" href="#" role="button" aria-haspopup="true" aria-expanded="false"><img src={dropDown} width="30" height="30"/></a>
                            <div style={dropLeft} className="dropdown-menu">
                                <a className="dropdown-item" href="#">Action</a>
                                <a className="dropdown-item" href="#">Another action</a>
                                <a className="dropdown-item" href="#">Something else here</a>
                                <div className="dropdown-divider"></div>
                                <a className="dropdown-item" href="#">Separated link</a>
                            </div>

                        </div>

                    </div>

                </nav>

            </div>
        );
    }
}

export default Header;
